import styled from "styled-components"
import Seguidor from "../components/Seguidor"

export default function Busca(){
    return (
        <PaginaSeguidores>
        <div className="titulo">
            <h1 >Bora buscaralho</h1>
        </div>
        <ContainerSeguidores>

                <Seguidor
                    nome="Fodaase"
                    foto="https://i.pinimg.com/originals/ba/92/7f/ba927ff34cd961ce2c184d47e8ead9f6.jpg"
                    biografia="QUero q vc se foda"
                    id="2"
                />

<Seguidor
                    nome="Fodaase"
                    foto="https://i.pinimg.com/originals/ba/92/7f/ba927ff34cd961ce2c184d47e8ead9f6.jpg"
                    biografia="QUero q vc se foda"
                    id="2"
                />


        </ContainerSeguidores>
    </PaginaSeguidores>
)
            }

            const PaginaSeguidores = styled.main`
width: 100%;
height: 90%;
display: flex;
flex-direction: column;
align-items: center;
.titulo{
    height: 10%;
    display: flex;
    align-items: center;
}
h1{
    color: black;
}
`

const ContainerSeguidores = styled.div`
width: 60%;
height: 85%;
overflow-y: scroll;
`
